func Test_eventualSafeNodes(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, eventualSafeNodes(tc.graph), "输入:%v", tc)
	}
}

func Benchmark_eventualSafeNodes(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			eventualSafeNodes(tc.graph)
		}
	}
}
